import React from "react";
import {Navbar} from "react-bootstrap";

function Nav() {
    return (
<>
  <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="#home">
      <img
        alt=""
        src="/logo.svg"
        width="30"
        height="30"
        className="d-inline-block align-top"
      />{' '}
      Kenny Nguyen
    </Navbar.Brand>
  </Navbar>
</>
    );
}

export default Nav;
